import TelaLogin from "./TelaLogin";

function App () {
    return (
        <>
        <h1>APP</h1>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<TelaLogin />}/>
            </Routes>
        </BrowserRouter>
        </>
    )
}

